// import logo from './logo.svg';
import './App.scss';
// import Greet from './components/Greet';
import Nav from './components/Nav/Nav';
import SideNav from './components/SideNav/SideNav.js';
import Profile from './components/Profile/Profile.js';
import Projects from './components/Projects/Projects';
import Footer from './components/Footer/Footer';
import Main from './components/Main/Main';

// fix dark mode
function mySwitch() {
	var element2 = document.body;
	element2.classList.toggle('dark');
}

document.querySelector(function () {
	document.querySelector('.prj-wrap').click(function () {
		document.querySelector('.wrap-content').classList.toggle('open');
		document.querySelector(this).classList.toggle('open');
	});
});

function App() {
	return (
		<div className='App'>
			<Nav />
			<SideNav />
			<Main />
			<Footer />
		</div>
	);
}

export default App;
